const initialState = {
  yandexDrive: '29999',
    delimobil: '',
    belkaCar: '',
    youDrive: '',
    rentmee: '',
    bibi: ''
}

export default function adminReducer(state = initialState, action ) {
  switch (action.type){
    default:
      return state
  }
}
